import { Header } from "../Header/Header";
import "./Courses.css";
import { Top } from "../2Top-Button/2Top.js";

const Courses = () => {
    return (
        <div id={ "home" }>
            <Header siteName={ "Kurzy" } />

            <div className={ "title-div" }>
                <h1 className={ "secondary-title" } id={ "title" }>Všetky naše kurzy</h1>
            </div>

            <Top />
        </div>
    )
}

export { Courses };
